// src/employee/pages/Dashboard.js
import React from 'react';
import { Link } from 'react-router-dom';
import './'
const EmployeeDashboard = () => {
    return (
        <div className="container">
            <h2>Employee Dashboard</h2>
            <p>Quick links to various functionalities:</p>
            <div className="employee-dashboard-buttons">
                <Link to="/employee/request-question-bank">
                    <button>Request Question Bank</button>
                </Link>
                <Link to="/employee/self-assessment">
                    <button>Self Assessment</button>
                </Link>
                <Link to="/employee/submit-feedback">
                    <button>Submit Feedback</button>
                </Link>
                <Link to="/employee/learning-development">
                    <button>Learning and Development</button>
                </Link>
                <Link to="/employee/request-learning-plan">
                    <button>Request Learning Plan</button>
                </Link>
                <Link to="/employee/logout">
                    <button>Logout</button>
                </Link>
            </div>
        </div>
    );
};

export default EmployeeDashboard;
